import React,{Component} from "react";

class CardTemp extends Component {
  constructor(props){
    super(props);
  
  }
  
  componentWillMount(){
    this.img= require("../uploads/events/" + this.props.img);
    
  }
  render(props) { 
    return (
    
            <div className="col-lg-4 col-sm-6 portfolio-item">
              <div className="card h-100">
                <a href="#"><img className="card-img-top" src={this.img}  alt=""/></a>
                <div className="card-body">
                  <h4 className="card-title">
                    <a href="#"> {this.props.title}</a>
                  </h4>
                  <p className="card-text">
                  <ReadMoreReact text={this.taile.text}
                                min={this.taile.min}
                                ideal={this.taile.ideal}
                                max={this.taile.max}
                                readMoreText={<button className="btn btn-primary btn-xs" >Read more</button>}/>
                  </p>
                </div>
            </div>
        </div> 
        
    );
  }
}
 
export default CardTemp;
